import React, { Profiler } from 'react';
import '../App.css';
import "react-responsive-carousel/lib/styles/carousel.min.css";
import { Carousel } from 'react-responsive-carousel';

const Project = () => (
    <Carousel
          showArrows={true}
          showThumbs={false}
          useKeyboardArrows={true}
          dynamicHeight={true}
          showStatus={false}
          infiniteLoop={true}
          showIndicators={true}
          autoPlay={true}
          stopOnHover={true}
          interval={5000}
        >
          {this.props.img1}
          {this.props.img2}
        </Carousel>
  );
  
  export default Project;
